import React from 'react';
import UCCRegistrationForm from './UCCRegistrationForm';

export default function UccRegistration() {
  const handleSubmitUCC = async (clientDetails) => {
    try {
      const response = await fetch('http://localhost:4000/api/register-ucc', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(clientDetails),
      });
      
      const data = await response.json();
      
      if (!response.ok) {
        throw new Error(data.error || 'Failed to register UCC');
      }
      
      alert('UCC Registration successful!');
      return data;
    } catch (error) {
      console.error('UCC Registration failed:', error);
      alert('UCC Registration failed: ' + error.message);
      throw error;
    }
  };

  return (
    <div className="container mt-4">
      <h2>UCC Registration</h2>
      <UCCRegistrationForm onSubmit={handleSubmitUCC} />
    </div>
  );
}
